export default function Logo({ width, height, theme }) {
  if (theme === 'dark') {
    return <DarkLogo width={width} height={height} />
  }
  return <LightLogo width={width} height={height} />
}

const LightLogo = ({ width, height }) => {
  return (
    <a href="/light">
      <svg
        width={220}
        height={51}
        viewBox="0 0 220 51"
        fill="none"
        xmlns="http://www.w3.org/2000/svg"
        xmlnsXlink="http://www.w3.org/1999/xlink"
      >
        <rect width={220} height={51} fill="url(#pattern0)" />
        <defs>
          <pattern
            id="pattern0"
            patternContentUnits="objectBoundingBox"
            width={1}
            height={1}
          >
            <use
              xlinkHref="#image0_93_11775"
              transform="matrix(0.000546741 0 0 0.00235849 -0.000814751 0)"
            />
          </pattern>
          <image
            id="image0_93_11775"
            width={1832}
            height={424}
            xlinkHref="data:image/png;base64,"
          />
        </defs>
      </svg>
    </a>
  )
}

